t=0

camera = {
	x=0,y=0,px,py
}

player = {
 x,y,rot,swim
}

monster = {
	x,y,rot
}

game = {
	state = 0,
	init = -1
}

-- FONCTION PRINCIPALE
-- --------------------
function TIC()
 t=t+2
 if game.state == -1 then flyBy() end
 if game.state == 0 then attractMode() end
 if game.state == 1 then solo() end
 if game.state == 2 then arena() end
	 
end

-- FLYBY
-- -------------------------

function flyBy()
 cls(0)
 if btn(0) then camera.y = camera.y - 1 end
 if btn(1) then camera.y = camera.y +1 end
 if camera.y < 0 then camera.y =0 end
 if camera.y > 135 then camera.y =135 end
 if btn(2) then camera.x = camera.x -1 end
 if btn(3) then camera.x = camera.x +1 end
 if camera.x < 0 then camera.x =0 end 
 if camera.x > 239 then camera.x = 239 end
 drawMap(camera.x, camera.y)
 --show coordinates
 c=string.format('(%03i,%03i)',toInt(camera.x),toInt(camera.y))
 rect (0,0,52,8,0)
 print(c,0,0,12,1)
end

-- ATTRACT MODE
-- --------------------------

function initAttract()
 player.x = 80
 player.y = 11
 player.rot = -1
 monster.x = 73
 monster.y = 11
 monster.rot = 0
 camera.x = 72
 camera.y = 8

end

function attractMode()
if game.init == -1 then initAttract() game.init=1 end
	cls(0)
	updatePlayer()
	updateMonster()
	drawMap(camera.x,camera.y)
	drawPlayer()
	drawMonster()
	drawWelcome()
end

function drawWelcome()
	print("Axayacalt's",75,1*24+6,10,2,2)
	print("Tomb",125,2*24,10,2,2)
	print("A TIC-80 game by gist974",50,5*24+2,1,1,1)
	print("Graphics: Petitjean & Shurder",35,5*24+10,1,1,1)
end


-- ARENA
-- --------------------------
function initArena()
 player.x = 76
 player.y = 27
 player.rot = -1
 player.swim = -1
 camera.x = player.x
 camera.y = player.y
end

function arena()
	if game.init == -1 then initArena() game.init=1 end
	cls(0)
	updatePlayer()
	-- updateMonster()
	camera.x = player.x-5
	camera.y = player.y-2
	drawMap(camera.x,camera.y)
	drawPlayer()
	-- drawMonster()
end


-- GAME
-- --------------------------
function initSolo()
 player.x = 59
 player.y = 6
 player.rot = -1
 camera.x = player.x
 camera.y = player.y
end

function solo()
	if game.init == -1 then initSolo() game.init=1 end
	cls(0)
	updatePlayer()
	-- updateMonster()
	camera.x = player.x-4
	camera.y = player.y-2
	drawMap(camera.x,camera.y)
	drawPlayer()
	-- drawMonster()
end


-- INPUTS
-- ----------------------

function updatePlayer()

 -- Mouvement
 -- Avance vers le haut
 if btnp(0) then 
	if playerAccess(player.x,player.y-1) == 1 then
  	 player.rot = 0
  	 player.y = player.y -1
	end
 end
   
 -- Avance vers le bas
 if btnp(1) then 
	 if playerAccess(player.x,player.y+1) == 1 then
 	 player.rot = 2
  	player.y= player.y +1
	 end
 end
 -- Avance vers la gauche
 if btnp(2) then 
  if playerAccess(player.x-1,player.y) == 1 then
	  player.x = player.x -1
	  player.rot = 3
	 end
 end
  -- Avance vers la droite
  if btnp(3) then 
   if playerAccess(player.x+1,player.y) == 1 then
	   player.rot = 1
	   player.x = player.x +1
	 end
 end
 
 -- Very important player state update
  player.state = playerState (player.x , player.y)
 
 -- if btn(4) then player.rot = 270 end  -- X
  --if btn(5) then player.rot = 180 end   -- O
 -- if btn(6) then player.rot = 90 end	  --Triangle
 -- if btn(7) then player.rot = 0 end  -- Carre
end


function playerAccess (x,y)
 val = mget(x,y)
 if val== 1  or val == 2 or val == 3  or val == 39 or val == 12  or val == 23  or val == 15 or val == 17 or val == 20 or val == 21 or val == 22 or val == 37 then
  return -1
 else
  return 1
 end
end

function playerState (x,y)
  val = mget(x,y)
   if val== 14 then
    return 1
    else
    return -1
   end
   end

function updateMonster()
 if monster.x < 73 then
	 monster.rot = 0
	end
	if monster.x > 77 then
	 monster.rot = 1
	end
	if monster.rot == 0 then
	 monster.x = monster.x + 0.05
	end
	if monster.rot == 1 then
		monster.x = monster.x - 0.05
	end
end	


-- SPRITE  ANIMATION
-- -----------------------------

function drawPlayer()
 if player.state == 1 then
  if player.rot == -1 then spr(268,(player.x-camera.x)*24,(player.y-camera.y)*24,15,1,0,0,3,3) end
  if player.rot >= 0 then spr(268,(player.x-camera.x)*24,(player.y-camera.y)*24,15,1,0,player.rot,3,3) end	
 else 
  if player.rot == -1 then spr(256,(player.x-camera.x)*24,(player.y-camera.y)*24,15,1,0,0,3,3) end
  if player.rot == 0 then  spr(262,(player.x-camera.x)*24,(player.y-camera.y)*24,15,1,0,0,3,3) end	
  if player.rot == 1 then spr(259,(player.x-camera.x)*24,(player.y-camera.y)*24,15,1,0,0,3,3) end	
  if player.rot == 2 then spr(256,(player.x-camera.x)*24,(player.y-camera.y)*24,15,1,0,0,3,3) end	
  if player.rot == 3 then spr(259,(player.x-camera.x)*24,(player.y-camera.y)*24,15,1,1,0,3,3) end	
 end
end
   
   
   function drawMonster()
	   spr(352+t%60//30*3,(monster.x-camera.x)*24,(monster.y-camera.y)*24,0,1,monster.rot,0,3,3)
   end
   
-- Draw Sprites
function drawMap(x,y) -- draw 64x64 Sprite Map
	x = toInt(x)
	y= toInt(y)
	for i=0,9 do
	 for j=0,5 do
		-- Get the mini-sprite value from TIC-80 map
		val=peek(0x08000+(i+x)+(j+y)*240)
		drawMapSprite(val,i,j)
	 end
 end
end


-- FONCTIONS D'AFFICHAGE
-- --------------------------------------------------

function drawMapSprite(val,i,j)
 -- Wall 1 
 if val == 1 then spr(65,i*24,j*24,-1,1,0,0,3,3) end
 -- Secret Wall 1
 if val == 2 then
	 spr(65,i*24,j*24,-1,1,0,0,3,3)
	 spr(80,i*24+8,j*24+8,-1,1,0,0,1,1)
