-- FONCTION UTILITAIRE
-- -------------------------------
function toInt(n)
    local s = tostring(n)
    local i, j = s:find('%.')
    if i then
        return tonumber(s:sub(1, i-1))
    else
        return n
    end
end

-- Linear Interpolation
function lerp(a,b,mu)
	return a*(1-mu)+b*mu
end



